import React from 'react'
import styled from 'styled-components'
import vector1 from '../images/vector1.png'
import vector2 from '../images/vector2.png'
import icon1 from '../images/icon1.png'
import icon2 from '../images/icon2.png'
import project from '../images/project.png'
import marketing from '../images/marketing.png'
import analytics from '../images/analytics.png'

const Container=styled.div`
display:flex;
flex-direction:column;
position: absolute;
align-items:center;
width: 1512px;
height: 6723px;
top: 1290px;`

const Data=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
margin:50px;
gap: 40px;
`
const DataBlock=styled.div`
width: 256px;
height: 160px;
display: flex;
flex-direction:column;
gap:10px;
align-items: center;
text-align: center;
letter-spacing: -1.2px;`

const Num=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 37px;
line-height: 48px;
color: #061237;
`
const Head=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 32px;
letter-spacing: -0.16px;
color: #061237;
`
const Disc=styled.div`
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 32px;
letter-spacing: -0.16px;
color: #67718E;
`
const VideoDiv=styled.div`
position: absolute;
width: 992px;
height: 908px;
top: 300px;
`

const VideoTitle=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
isolation: isolate;
width: 992px;
height: 64px;
left: 0px;
top: 0px;`

const GreyDiv=styled.div`
position: absolute;
width: 64px;
height: 64px;
left: 0px;
top: 0px;
background: #F7F9FC;`

const Title=styled.p`
position:absolute;
top:20px;
left:20px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 14px;
line-height: 24px;
letter-spacing: 1.5px;
color: #67718E;
z-index: 1;
`

const VideoHead=styled.div`
position: absolute;
width: 721px;
height: 56px;
left: 0px;
top: 95px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 48px;
line-height: 56px;
letter-spacing: -1.44px;
color: #061237;`

const Video=styled.div`
position: absolute;
width: 992px;
height: 550px;
left: 0px;
top: 208px;
`

const Div1=styled.div`
position: absolute;
width: 92px;
height: 92px;
left: -92px;
bottom: -92px;
background: #F2F3F8;`

const Vector1=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
position: absolute;
left: -148.8px;
right: 822.8px;
top: 404.5px;
z-index:-1;
`
const VideoDesc=styled.div`
position: absolute;
width: 525.87px;
height: 108px;
right: 18.13px;
top: 789px;
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 18px;
line-height: 200%;
display: flex;
align-items: center;
letter-spacing: -0.18px;
color: #37456C;
`
const Explore=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
gap: 42px;
position: absolute;
width: 1120px;
height: 600px;
left: 196px;
top: 85em;`

const Left=styled.div`
width: 588px;
height: 600px;
`
const Div2=styled.div`position: absolute;
width: 64px;
height: 64px;
left: 0px;
top: 0px;
background: #F7F9FC;`

const ExHead=styled.div`
position: absolute;
width: 377.29px;
height: 115px;
left: 0px;
top: 94px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 48px;
line-height: 56px;
display: flex;
align-items: center;
letter-spacing: -1.44px;
color: #061237;
`
const ExDesc=styled.div`
display: flex;
flex-direction: column;
align-items: flex-start;
padding: 0px 25.675px 0px 0px;
gap: 34px;
position: absolute;
width: 524px;
height: 210px;
left: 64px;
top: 216px;`

const ExText=styled.p`
width: 498.33px;
height: 128px;
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 200%;
display: flex;
align-items: center;
letter-spacing: -0.16px;
color: #37456C;`

const ExButton=styled.button`
display: flex;
flex-direction: row;
align-items: flex-start;
text-align: center;
font-family: 'Inter';
font-weight: 500;
font-size: 14px;
line-height: 24px;
padding: 11px 42.0781px 13px 41px;
width: 157.08px;
height: 48px;
color: #FFFFFF;
background: #1355FF;`

const Right=styled.div`
width: 588px;
height: 600px;
`
const Line1=styled.div`
position:absolute;
width:350px;
height: 184px;
right: 40px;
top: 0px;
left:650px;
background: #FFFFFF;
bottom:600px;
`
const Line2=styled.div`
position:absolute;
width:350px;
height: 184px;
right: 40px;
top: 235px;
left:650px;
background: #FFFFFF;
`
const Icon=styled.div`
width: 40px;
height: 0px;
`

const Point=styled.p`
position:absolute;
left:50px
width: 240.51px;
height: 62px;
top: 50px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 24px;
line-height: 133%;
letter-spacing: -0.28px;`

const Vector2=styled.div`
position: absolute;
width: 490px;
height: 594.85px;
z-index:-1;
left:600px;
`
const Div3=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
position: absolute;
width: 100%;
height: 818px;
left: 0px;
top: 2040px;
background: #061237;`

const Ways=styled.div`
position:absolute;
left:13em;
top:5em;
right:13em;
bottom:5em;
width: 1120px;
height: 658px;
`
const HeadDiv=styled.div`
position: absolute;
width: 1120px;
height: 68px;
left: 0px;
top: 0px;`

const HeadText=styled.div`
position: absolute;
width: 471px;
height: 56px;
left: 92px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 48px;
line-height: 56px;
display: flex;
align-items: center;
letter-spacing: -1.44px;
color: #FFFFFF;`

const Button=styled.button`
box-sizing: border-box;
display: flex;
flex-direction: row;
align-items: center;
padding: 13px 33px 15px 34px;
text-align:center;
position: absolute;
width: 142.67px;
height: 52px;
left: 885.33px;
background: #1355FF;
border: 2px solid #1355FF;
color: #FFFFFF;
`

const Cards=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
gap: 32px;
position: absolute;
width: 1120px;
height: 550px;
left: 0px;
top: 108px;`

const Card1=styled.div`
display: flex;
flex-direction: column;
align-items: flex-start;
padding: 24px;
gap: 32px;
width: 352px;
height: 550px;`

const Card2=styled.div`
display: flex;
flex-direction: column;
align-items: flex-start;
padding: 24px;
gap: 32px;
width: 352px;
height: 550px;`

const Card3=styled.div`
display: flex;
flex-direction: column;
align-items: flex-start;
padding: 24px;
gap: 32px;
width: 352px;
height: 550px;`

const CardDiv1=styled.div`
position: absolute;
width: 64px;
height: 64px;
left:265px;
top: 24.2px;
background: #1355FF;`

const CardDiv2=styled.div`
position: absolute;
width: 32px;
height: 32px;
left:290px;
top: -8px;
background: #18264E;`

const Img=styled.div`
height: 320px;
left: 0px;
right: 0px;
top: calc(50% - 320px/2);`

const Way=styled.p`
width: 240px;
height: 32px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 24px;
line-height: 32px;
display: flex;
align-items: center;
letter-spacing: -0.28px;
color: #FFFFFF;`

const WayDesc=styled.div`
width: 298.9px;
height: 96px;
font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 16px;
line-height: 32px;
display: flex;
align-items: center;
letter-spacing: -0.16px;
color: #B6BCCE;
`

const Components=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
gap: 32px;
position: absolute;
width: 1120px;
height: 376px;
left: 196px;
top: 2940px;`


const Info = () => {
  return (
    <Container>
        <Data>
          <DataBlock>
            <Num>99.95%</Num>
            <Head>Accuracy rate</Head>
            <Disc>in fulfilling orders</Disc>
          </DataBlock>
          <DataBlock>
            <Num>5,000+</Num>
            <Head>Ecommerce businesses</Head>
            <Disc>partner with Opus</Disc>
          </DataBlock>
          <DataBlock>
            <Num>99.96%</Num>
            <Head>Of orders ship on time</Head>
            <Disc>within SLA</Disc>
          </DataBlock>
          <DataBlock>
            <Num><span style={{color:"#DADDE7"}}>#</span>1</Num>
            <Head>Best Fulfillment Technology</Head>
            <Disc>by AdWeek’s Retail Awards</Disc>
          </DataBlock>
        </Data>
        <VideoDiv>
          <VideoTitle>
            <GreyDiv></GreyDiv>
            <Title>VIDEO TITLE</Title>
          </VideoTitle>
          <VideoHead>Inform users with video sections</VideoHead>
          <Video>
            <video width="992px" height="550px" controls="controls" autoplay="true"/>
            <Div1></Div1>
            <Vector1><img src={vector1}/></Vector1>
          </Video>
          <VideoDesc>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat. Praesent pulvinar arcu non lectus dapibus, a pulvinar mauris aliquam.</VideoDesc>
        </VideoDiv>
        <Explore>
          <Left>
            <Div2></Div2>
            <ExHead>Make your site better with Opus</ExHead>
            <ExDesc>
              <ExText>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat. Praesent pulvinar arcu non lectus dapibus, a pulvinar mauris aliquam.
</ExText>
              <ExButton>Learn More</ExButton>
            </ExDesc>
          </Left>
          <Right>
            <Line1>
              <Icon><img src={icon1}/></Icon>
              <Point>Build or Customize a Website in Minutes
</Point>
            </Line1>
            <Line2>
              <Icon><img src={icon2}/></Icon>
              <Point>Our UI Kit was made for creativity.</Point>
            </Line2>
          </Right>
          <Vector2><img src={vector2}/></Vector2>
        </Explore>
        <Div3> 
          <Ways>
            <HeadDiv>
              <HeadText>Ways to work with us</HeadText>
              <Button>Get Started</Button>
            </HeadDiv>
            <Cards>
              <Card1>
                <Img><img src={project}/></Img>
                <CardDiv1></CardDiv1>
                <CardDiv2></CardDiv2>
                <Way>Project Management</Way>
                <WayDesc>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat.</WayDesc>
              </Card1>
              <Card2>
                <Img><img src={analytics}/></Img>
                <CardDiv1></CardDiv1>
                <Way>Advanced Analytics</Way>
                <WayDesc>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat.</WayDesc>
              </Card2>
              <Card3>
                <Img><img src={marketing}/></Img>
                <CardDiv1></CardDiv1>
                <CardDiv2></CardDiv2>
                <Way>Marketing & Dashboard</Way>
                <WayDesc>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat.</WayDesc>
              </Card3>
            </Cards>
          </Ways>
        </Div3>
        <Components>
          <Left>
          <ExHead>Make your site better with Opus</ExHead>
            <ExDesc>
              <ExText>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eget consectetur eros. Aliquam erat volutpat. Praesent pulvinar arcu non lectus dapibus, a pulvinar mauris aliquam.
</ExText>
              <ExButton>Learn More</ExButton>
            </ExDesc>
          </Left>
        </Components>
        {/* <Features></Features>
        <Knowledge></Knowledge>
        <Stamps></Stamps>
        <Resources></Resources> */}
    </Container>
  )
}

export default Info
